import { Rings } from 'react-loader-spinner';

const InProgressView = () => 
    <div className='h-screen bg-cover bg-[#F9EBDE] text-center flex items-center justify-center'>
        <Rings
        height={80}
        width={80}
        color="#815854"
        radius="10"
        wrapperStyle={{ marginTop: '20px', backgroundColor: '#f0f0f0' }}
        wrapperClass=""
        visible={true}
        ariaLabel="rings-loading"
        />   
    </div>


export default InProgressView;
